import React from 'react'

function TodoList( {data}) {
    return (
        <div className="todo-list">
            <div className="bottom-row">
                <p>{data}</p>
                <p>5 items left</p>
                <p>Clear completed</p>
            </div>
        </div>
    )
}

export default TodoList
